    /**
     *   优化后的查找无重复字符串最大值算法
     *
     * @param str
     * @return
     */
    private static Integer findLengthOfLongestSubstringOptimization(String str) {
        // 最大无重复元素的子序列长度
        int max = 0;
        // 子序列开始位置
        int start = 0;
        // 子序列结束位置
        int end = 0;
        // 遍历 str 获取子序列
        for (int i = 0; i < str.length(); i++){
            // 如果子序列中含有该字符，找到子序列中的该元素的位置
            for (int j = start; j <= end; j++){
                if (str.charAt(j) == str.charAt(i) && j != i){
                    // 并将该索引 + 1 当做新的子序列的开始位置，前面的元素都可以过滤掉
                    start = j + 1;
                }
            }
            // 子序列中没有改元素，则子序列长度 + 1
            end++;
            max = Math.max(max, end - start);

        }
        return max;
    }

    /**
     *  暴力求解，找到所有子序列，逐个进行去重判断
     *
     * @param s
     * @return
     */
    private static Integer findLengthOfLongestSubstring(String s) {
        int max = 0;
        // 找到字符串的所有子序列
        for (int i = 0; i < s.length(); i++){
            for (int j = i+1; j <= s.length(); j++){
                // 判断子序列的元素是否全部不重复
                boolean isUnqie = checkUnique(s, i, j);
                if (isUnqie){
                    // 获取最长子序列的长度
                    max = Math.max(max, j - i);
                }else {
                    break;
                }
            }
        }
        return max;
    }

    /**
     *   检查字符串 s 从 i 到 j 的子序列元素是否全部不重复
     *
     * @param s
     * @param start
     * @param end
     * @return
     */
    private static boolean checkUnique(String s, int start, int end) {
        // 建立一个存储字符的 set 集合
        Set<Character> characterSet = new HashSet<Character>();
        for (int k = start; k < end; k++){
            if (characterSet.contains(s.charAt(k))){
                return false;
            }
            characterSet.add(s.charAt(k));
        }
        return true;
    }
